const fileReaderToString = async (filePath) => {
  return new Promise((resolve, reject) => {
    fs.readFile(filePath, (err, fileData: any) => {
      if (err) {
        return reject(err);
      }
      try {
        return resolve(fileData.toString('utf8'));
      } catch(err) {
        console.log('fileReaderToString', err);
        return reject(null);
      }
    });
  });
};


